import React, {useState} from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { EntryConext } from './context/EntryContext.js';

import HomePage from './pages/HomePage.js';
import LoginPage from './pages/LoginPage.js';
import RegisterPage from './pages/RegistrationPage.js';
import InputPage from './pages/InputPage.js';
import OutputPage from './pages/OutputPage.js';

export default function App() {
  const [entryConext, setEntryContext] = useState("null");
  return (
    <EntryConext value={[entryConext, setEntryContext]}>
      <Router>
          <Switch>
            <Route exact path="/">
              <HomePage />
            </Route>
            <Route exact path="/login">
              <LoginPage />
            </Route>
            <Route exact path="/register">
              <RegisterPage />
            </Route>
            <Route exact path="/input">
              <InputPage />
            </Route>
            <Route exact path="/output">
              <OutputPage />
            </Route>
          </Switch>
      </Router>
    </EntryConext>
  );
}
